window.bridges["generate-random-bytes"]=function(){return{converter:function(){for(var t=this.options.get(),n=t.format,e=+t.count,r="",o=0;o<e;o++){var i=parseInt(256*Math.random(),10);if("hex"==n)1==(i=i.toString(16)).length&&(i="0"+i);else if("bin"==n)for(i=i.toString(2);i.length<8;)i="0"+i;else if("oct"==n)for(i=i.toString(8);i.length<3;)i="0"+i;else"dec"==n&&(i=i.toString(10));r+=i,r+=" "}return r+="\n"},config:{}}};